import React from 'react';
import {Navbar} from 'react-bootstrap';
import './Footer.css';

//fixed="bottom"
const Footer = () => {

    return (
        <div className="footer"> 
        <Navbar   >
            <Navbar.Text> PANKOD CHALLENGE PROJECT</Navbar.Text>          
        </Navbar>
        </div>

    );
};

export default Footer;
